snippet.textDisplay:
Where the mind is fearless, the head is held high with pride ;
Where free thoughts reign supreme ;
Where the people are not the prisoners in cells of religions, castes and nationalism ;
Where the free speech flows from the bottom  of the heart ;
Where  unbounded work ethic leads people to succeed ;
Where the clear stream of reason does not disappear in the desert sand of prejudice ;
Where the moral strength is not shattered into thousand pieces ;
Where You are the constant source of all actions, thoughts and happiness ;
Here in India, oh my Father, arouse the people to create a heaven on earth.

